import React from 'react';
import './Contact.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faGithub, faLinkedinIn } from '@fortawesome/free-brands-svg-icons';

const team = [
  {
    name: "Saharsh",
    email: "ee240002063@iiti.ac.in",
    github: "https://github.com/Saharsh525",
    linkedin: "https://www.linkedin.com/in/saharsh-chokhandre-a0748121a/"
  },
  {
    name: "Sreyan",
    email: "ep240051018@iiti.ac.in",
    github: "https://github.com/SreyanReddy",
    linkedin: "https://www.linkedin.com/in/sreyan-reddy-regatte-865849314/"
  },
  {
    name: "Abhishek",
    email: "mems240005038@iiti.ac.in",
    github: "https://github.com/Abhishek1175",
    linkedin: "https://www.linkedin.com/in/rathod-abhishek-349617367/"
  },
  {
    name: "Vikram",
    email: "cse240001078@iiti.ac.in",
    github: "https://github.com/vikky737",
    linkedin: "https://www.linkedin.com/in/velpula-vikram-varma-3137aa339/"
  },
  {
    name: "Pankaj",
    email: "ee240002048@iiti.ac.in",
    github: "https://github.com/Pankajydv123",
    linkedin: "https://www.linkedin.com/in/pankaj-kumar-yadav-110037331/"
  }
];

export default function Contact() {
  return (
    <section className="contact-us-section">
      <div className="contact-intro">
        <h1>Contact Us</h1>
        <p>We are a team of students from IIT Indore passionate about AI-powered photo and video editing tools.</p>
      </div>

      <div className="team-grid">
        {team.map((member, idx) => (
          <div key={idx} className="team-card">
            <h3>{member.name}</h3>
            <a href={`mailto:${member.email}`}>
              <FontAwesomeIcon icon={faEnvelope} className="contact-icon" />
            </a>
            <a href={member.linkedin} target="_blank" rel="noopener noreferrer">
              <FontAwesomeIcon icon={faLinkedinIn} className="contact-icon" />
            </a>
            <a href={member.github} target="_blank" rel="noopener noreferrer">
              <FontAwesomeIcon icon={faGithub} className="contact-icon" />
            </a>
          </div>
        ))}
      </div>

      <div className="bottom-note">
        <p>Have questions or feedback? Email any of us or reach out via our LinkedIn profiles.</p>
      </div>
    </section>
  );
}
